    setFonormData(prevstate=>
         {
        const [name, type, value, checked] = event.target
        return {
            ...prevstate,
             [name]: type === checked ? false : value
        }
    })
} 
    return (
        <form>
            <input 
            placeholder="First Name"
            type="text"
            on
